import Link from "next/link";
import ProfilePic from "../images/profile_pic.png";

const LandingHeader = () => (
  <div className="landing">
    <section id="intro">
      <h1>Woo Young Choi</h1>
      <p>Software engineer based in New York, NY.</p>
      <p>Specializing in building and designing websites and applications.</p>
    </section>
    <section id="about">
      <div id="picture">
        <a href="https://github.com/wc356">
          <div className="img--container">
            <img src={ProfilePic} alt="profile picture" />
          </div>
        </a>
      </div>
      <div id="bio"></div>
    </section>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: "Futura";
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }

        #intro {
          min-height: 1vh;
        }

        h1 {
          color: #3366cc;
          font-size: 50px;
          font-weight: 600;
        }

        p {
          color: #3366cc;
          font-size: 18px;
        }

        #picture {
          height: 400px;
          width: 400px;
        }

        .img--container {
          cursor: pointer;
          display: block;
          overflow-x: hidden;
          overflow-y: hidden;
          position: relative;
        }

        img {
          width: 100%;
          height: 100%;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
